import Container from "../../components/Container/Container";
import Card from "../../components/Card/card";
// import PortfolioNav from "../../components/PortfolioNav/PortfolioNav";
import { Link, Route } from "react-router-dom";
import WebProject from "../WebProject/WebProject";

class Portfolio extends Component {
  render() {
    return (
      <Container>
        {/* <PortfolioNav button1="Web" button2="Fashion" button3="Paint" /> */}

        <Card title="Meet">

      <Link to="/meet" role="button" className="btn btn-link btn-red-color">  
        See More
      </Link>{" "}
        <Link to="/portfolio" role="button" className="btn btn-link btn-red-color">
         See Less
          </Link>
<WebProject></WebProject>
          <Route exact path="/meet" component={WebProject} />


</Card>



      </Container>
    );
  }
}

export default Portfolio;
